Michelangelo is one of the worlds most powerful and versatile artists of the sixteenth century. He spent ninety years of &quot;torments and ecstasy&quot;, carving from marble the deep soul of troubled figures. He was a sculptor, but also painter, architect, poet: an invaluable interpreter of the Renaissance period.
